(function(n){var i=abp.services.app.account,t=n("form[name=TenantChangeForm]");t.closest("div.modal-content").find(".save-button").click(function(n){n.preventDefault();var r=t.find("input[name=TenancyName]").val();if(!r){abp.multiTenancy.setTenantIdCookie(null);location.reload();return}i.isTenantAvailable({tenancyName:r}).done(function(n){switch(n.state){case 1:abp.multiTenancy.setTenantIdCookie(n.tenantId);location.reload();return;case 2:abp.message.warn(abp.utils.formatString(abp.localization.localize("TenantIsNotActive","AbpProjectName"),this.tenancyName));break;case 3:abp.message.warn(abp.utils.formatString(abp.localization.localize("ThereIsNoTenantDefinedWithName{0}","AbpProjectName"),this.tenancyName))}})})})(jQuery);